configure:
  commands:
    end:
      new_state: execute
    interface HundredGigE1/0/1: "interface HundredGigE1/0/1\r\n"
    interface HundredGigE1/0/6: "WARNING: Stackwise Virtual Configuration for HundredGigE1/0/1\
      \ will be removed.\r\n"
    line console 0:
      new_state: configure_line
    no logging console: ''
    no stackwise-virtual link 1: "interface HundredGigE1/0/6\r\n"
  prompt: farscape-pinfra-5(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: farscape-pinfra-5(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: farscape-pinfra-5#
